import React, { Component } from "react";
import { NavLink, Switch } from "react-router-dom";
import Homepage from "./Homepage.js";
import "./Header.css";

class Header extends Component {
  render() {
    return (
      <div>
        <header>
          <nav className="header">
            <div className="menu-container">
              <NavLink className="header-menu-text" exact to="/">
                LOGO
              </NavLink>
              <div className="searchheader">
                <NavLink
                  name="women"
                  onClick={event => this.props.onLink(event)}
                >
                  Women
                </NavLink>
                <NavLink name="men" onClick={event => this.props.onLink(event)}>
                  Men
                </NavLink>
                <NavLink
                  name="other"
                  onClick={event => this.props.onLink(event)}
                >
                  Other
                </NavLink>
              </div>
            </div>
          </nav>
        </header>
        <Switch>
          <Route exact path="/" component={Homepage} />
          <Route path="/filter1" component={Filter1} />
          <Route path="/filter2" component={Filter2} />
          <Route path="/filter3" component={Filter3} />
        </Switch>
      </div>
    );
  }
}

export default Header;
